import React from 'react';

function SLAPage() {
    return (
        <div className="container mt-5">
            <h2>SLA (Service Level Agreement)</h2>
            <div className="card">
                <div className="card-body">
                    <p className="card-text">Здесь будет информация о соглашении об уровне обслуживания.</p>
                </div>
            </div>
        </div>
    );
}

export default SLAPage;
